import './Navbar.css';

import React from 'react';
import { toBeRequired } from '@testing-library/jest-dom/dist/matchers';
function Na()
{
    return(
        <div>
<nav class="navbar">
     

    
     <ul class="nav-links">
  
       
       
       <div class="menu">
         <li><a href="#"><img src={require('./logo.jpg')} alt='logo' /></a></li>
         <li><a href="/">About</a></li>
         <li class="services">
           <a href="/">Top Cities</a>
          
           <ul class="dropdown">
             <li><a href="category.html">Chennai</a></li>
             <li><a href="/">Coimbatore</a></li>
             <li><a href="/">Salem</a></li>
             <li><a href="/">Vellore</a></li>
             <li><a href="/">Madurai</a></li>
             <li><a href="/">Erode</a></li>
             
           </ul>
         </li>
         <li><a href="/">Follow Us</a></li>
         <li><a href="/">Help</a></li>
       </div>
     </ul>
   </nav>

      </div>
 
       
        
       
            
    );

}
export default Na;
